import React from 'react';

function CreateProjectForm(props) {
  return (
    <Card>
      <CardTitle>Добавление проекта</CardTitle>
      
      <LineInput type="text" placeholder="Название проекта"/>
      
      <CardForm>
        <CardButtons>
          
          <MiniButton onClick={props.onClick}>
            Добавить
          </MiniButton>
        </CardButtons>
      </CardForm>
    </Card>
  );
}

export default CreateProjectForm;
